import React from 'react'

function Pending(props) {
  const pendingTasks = props.tasks.filter(task => task.status === 'pending')
  return (
    <div>
      <h2>Pending Task</h2>
      {
        pendingTasks.map(task => {
          return <li>{task.task_name}</li>
        })
      }
    </div>
  )
}

export default Pending
